import React, { useState, useEffect } from "react";
import axios from "axios";

const App = () => {
  const API_KEY = "5e5765a835fd5c6a2e13ed922a1a6f46";

  useEffect(() => {}, []);

  const [coords, setCoords] = useState({
    latitude: 39.74362,
    longitude: -8.80705,
  });

  const successPosition = ({ coords }) => {
    setCoords
  };

  const failurePosition = ({ message }) => {
    alert(message);
  };

  window.navigator.geolocation
    ? window.navigator.geolocation.getCurrentPosition(
        successPosition,
        failurePosition
      )
    : alert("Your browser doesn't support geolocation!");

  //axios.get(`https://api.openweathermap.org/data/2.5/onecall?lat=${lat}&lon=${lon}&exclude=${part}&appid=${API_KEY}`)

  return <div>APP</div>;
};

export default App;
